import './headitem.css'

function HeadItem(props){
    return(
    <div className='HeadItem-wrapper'>
        <div className="Icon-wrapper">
            <i className="active">{props.iconA}</i>
            <i>{props.iconB}</i>
        </div>
        <label>{props.title}</label>
    </div>
    );
}

export default HeadItem;
